{
  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC LITIGATION RELEASE 21249, OCTOBER 15, 2009: SEC (OR \"COMMISSION\") FILED A COMPLAINT AGAINST DEFENDANT WILLIAM T. DAILEY, III, ALLEGING VIOLATIONS OF SECTION 10(B) OF THE SECURITIES EXCHANGE ACT OF 1934 (\"EXCHANGE ACT\") AND RULE 10B-5 THEREUNDER.  THE SEC'S COMPLAINT ALLEGES THAT DAILEY AND OTHER DEFENDANTS ENGAGED IN TIPPING AND TRADING IN COMPANY STOCK PRIOR TO AN ANNOUNCEMENT THAT THE COMPANY WOULD BE ACQUIRED BY ANOTHER COMPANY. THE COMMISSION'S COMPLAINT ALLEGE THAT THROUGHOUT THE FALL OF 2005, ANOTHER DEFENDANT, APPRISED OF THE STATUS OF HIS COMPANY'S MERGER DISCUSSIONS, TIPPED SEVERAL FRIENDS AND HIS BROTHER, WHO IN TURN BOUGHT COMPANY STOCK AND TIPPED THE INFORMATION TO DAILEY.  DAILEY THEN BOUGHT COMPANY STOCK FOR HIS OWN ACCOUNT BASED ON THAT TIP. THE COMMISSION'S COMPLAINTS ALSO ALLEGE THAT, IN ADDITION TO THE SERIES OF TIPS AND TRADES IN THE FALL OF 2005, ON DECEMBER 7, 2005, AFTER BEING INFORMED THAT THAT THE MERGER DISCUSSIONS HAD CONCLUDED, THAT THE COMPANY WAS BEING ACQUIRED FOR $27 PER SHARE AND THAT THE TRANSACTION WOULD BE ANNOUNCED THE FOLLOWING DAY, ANOTHER DEFENDANT TOLD DAILEY KEY INFORMATION REGARDING THE IMPENDING MERGER. THE COMMISSION FURTHER ALLEGES THAT DAILEY CONVEYED THE INFORMATION THAT HE RECEIVED TO A SALES SPECIALIST AT A MAJOR FINANCIAL SERVICES FIRM, AND, BASED ON THAT INFORMATION, SHE THEN RECOMMENDED PURCHASING THE STOCK TO A TRADER IN HER FIRM, WHO BOUGHT COMPANY STOCK PRIOR TO THE ANNOUNCEMENT, AS WELL AS TO SEVERAL INSTITUTIONAL CLIENTS, TWO OF WHOM BOUGHT COMPANY STOCK PRIOR TO THE MERGER ANNOUNCEMENT. THE RESULTING TRADING PROFITS FROM THESE RECOMMENDATIONS WERE APPROXIMATELY $353,000.",
